import React,{useState} from 'react'

const Menubar = () => {
  const [color,setColor]=useState('transparent')
  const [color1,setColor1]=useState('transparent')
  const [color2,setColor2]=useState('transparent')
  const [color3,setColor3]=useState('transparent')

  const change1=()=>{
  
    setColor('rgb(96,165,250)')
  }
  const change2=()=>{
    setColor1('rgb(96,165,250)')
  }
  const change3=()=>{
    setColor2('rgb(96,165,250)')
  }
  const change4=()=>{
    setColor3('rgb(96,165,250)')
  }
  return (
    <div className=' backdrop-blur text-white text-center h-32'>
        <ul className='flex flex-col h-full justify-around'>
              <li style={{backgroundColor:{color}}} onClick={change1}>Home</li>
              <li style={{backgroundColor:{color1}}} onClick={change2}>Job Application Form</li>
              <li style={{backgroundColor:{color2}}} onClick={change3}>Guarantor Form</li>
              <li style={{backgroundColor:{color3}}} onClick={change4}>Contact</li>
        </ul>
        </div>
  )
}

export default Menubar
